import React, { Component } from 'react'

import Newsitems from './Newsitems'

export class News extends Component {
  render() {
    return (
      <div>
        this is a news component
       <Newsitems title="mytitle" description="des"/>
       <Newsitems/>
       <Newsitems/>
       <Newsitems/>
       <Newsitems/>
      </div>
    )
  }
}

export default News
